import React from "react";

export default function Card() {
  return (
    <div>
      <div>
        <div
          className="card m-3"
          style={{
            width: "16rem",
            maxHeight: "300px",
            border: " 2px solid white",
          }}
        >
          <img
            src="https://th.bing.com/th/id/OIP.OM_YQDFEEZ6NPj0XapYwFgHaEo?pid=ImgDet&rs=1"
            className="card-img-top"
            alt=""
          />
          <div className="card-body bg-black text-light">
            <h5 className="card-title">Card title</h5>
            <p className="card-text">Some quick example text to b</p>
            <div className="container w-100">
              <select className="m-2 h-95  bg-success rounded">
                {Array.from(Array(6), (e, i) => {
                  return (
                    <option key={i + 1} value={i + 1}>
                      {i + 1}
                    </option>
                  );
                })}
              </select>
              <select className="m-2 h-100 bg-success rounded">
                <option value="half">Half</option>
                <option value="full">Full</option>
              </select>
              <div className="d-inline h-100 fs-5"> price </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
